// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import OsobaList from './components/OsobaList'; // Importujemy komponent OsobaList

function App() {
    return (
        <Router>
            <div>
                <h1>Moja Aplikacja React</h1>
                <Link to="/osoba-lista">
                    <button>Kliknij mnie</button>
                </Link>

                <Route path="/osoba-lista" component={OsobaList} />
            </div>
        </Router>
    );
}

export default App;
